import React, { useState } from "react";
import TopBar from "../../Components/TopBar";
import { List, ListItem, ListItemText, Dialog, DialogTitle, DialogContent, DialogContentText, DialogActions, Button } from "@mui/material";

const WorkoutPage = () => {
    // TODO: Populate from the DB
    const dummyItems = [
        { id: 1, title: "Workout 1", description: "Description for Workout 1" },
        { id: 2, title: "Workout 2", description: "Description for Workout 2" },
        { id: 3, title: "Workout 3", description: "Description for Workout 3" },
    ];

    const [selectedItem, setSelectedItem] = useState(null);

    const handleClick = (item) => {
        setSelectedItem(item);
    };

    const handleClose = () => {
        setSelectedItem(null);
    };

    return (
        <div>
            <TopBar title="Workouts" titleColor="#ffffff"/>
            <div style={{ position: 'absolute', top: '60px', bottom: '0', width: '100%' }}>
                <List>
                    {dummyItems.map(item => (
                        <ListItem key={item.id} button onClick={() => handleClick(item)}>
                            <ListItemText primary={item.title} />
                        </ListItem>
                    ))}
                </List>
            </div>
            <Dialog open={selectedItem !== null} onClose={handleClose}>
                <DialogTitle>{selectedItem && selectedItem.title}</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        {selectedItem && selectedItem.description}
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Close</Button>
                </DialogActions>
            </Dialog>
        </div>
    );
}

export default WorkoutPage;
